import React from 'react';
import { Text, StyleSheet, TouchableOpacity } from 'react-native';

const Deliveries = ({ deliveries }) => {

  return (

    deliveries.forEach((delivery) => {
      console.log(delivery)
      delivery.map((prop, key) => {
        return (
          <TouchableOpacity style={styles.row} key={key} onPress={() => navigation.navigate('Delivery', { id: prop.id } )}>
            <Text style={styles.loginText}>Delivery {prop.id}</Text>
            <Text style={styles.loginText}>Store {prop.store}</Text>
            <Text style={styles.loginText}>Date {prop.date}</Text>
          </TouchableOpacity>
        );
      })
    }
    )
  )
}


export default Deliveries;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 20,
    paddingTop: 20,
    paddingBottom: 20,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  row: {
    backgroundColor: "#4169e1",
    width: "80%",
    height: 100,
    color: "#ffffff",
    textAlign: "center",
    justifyContent: "center",
    marginVertical: 5,
    padding: 5,
    borderRadius: 5
  }
});
